     * [(http(s)?):\/\/(www\.)?a-zA-Z0-9@:%._\+~#=]{2,256}\.[a-z]{2,6}\b([-a-zA-Z0-9@:%_\+.~#?&//=]*)
     * 
     */



    return(
        <div className={styles.optionContainer}>
            <img src={topFrame} alt="top frame" id={styles.topFrame}></img>
            {/*<p className={styles.text}>fashion</p>*/}
        </div>
    );
}

export default OptionTop
